import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 45.2-1635  Expiration of permits.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/45.2-1635.md","filePath":"vacode/45.2-1635.md"}'),i={name:"vacode/45.2-1635.md"},n=r('<h1 id="§-45-2-1635-expiration-of-permits" tabindex="-1">§ 45.2-1635 Expiration of permits. <a class="header-anchor" href="#§-45-2-1635-expiration-of-permits" aria-label="Permalink to &quot;§ 45.2-1635  Expiration of permits.&quot;">​</a></h1><p>Each permit issued pursuant to this chapter shall expire 24 months from its date of issuance unless the permitted activity has commenced within that time period. An operator may renew an existing permit for an additional 24 months by submitting a written request containing the coal operator&#39;s approval and remitting a $325 renewal fee no later than the expiration date.</p><p>1990, c. 92, § 45.1-361.33; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0854" target="_blank" rel="noreferrer">854</a>; 2003, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0542" target="_blank" rel="noreferrer">542</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0550" target="_blank" rel="noreferrer">550</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0387" target="_blank" rel="noreferrer">387</a>.</p>',3),o=[n];function s(p,c,l,_,h,f){return t(),a("div",null,o)}const g=e(i,[["render",s]]);export{m as __pageData,g as default};
